import React from "react";
import BookDetail from "./bookDetail";



const Book = ({ books }) => {
  console.log("Books");
  
  return (
    <div className="container"> 
        <div className="row"> 
          books.map((book, index) => (
            <BookDetail key={`${index}-${book.volumeInfo.title}`} book={book} />
          ))
        </div>
    </div>    
  );
};


export default Book;
